  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Tewaukon
  NWR and WMD outlines Refuge accomplishments during the 1975 fiscal year. The report
  begins by summarizing the weather conditions, habitat conditions, water conditions,
  and food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, and raptors- is also covered. The
  Refuge development and maintenance section discusses physical developments, plantings,
  vegetation control, and prescribed burning. Resource management is outlined; topics
  include haying and fur harvesting. A progress report on field investigations and
  applied research is also provided. The public relations section of the report describes
  recreational uses, hunting, violations, and safety. Items of interest are attached.\",\n\t\"owner_org\":
